import "./App.css";
import Main from "./pages/Main.js";
import Navbar from "./pages/Navbar";
import AdminPage from "./pages/AdminPage";
import CreateItem from "./pages/components/CreateItem";
import ItemPage from "./pages/components/ItemPage";
import CartPage from "./pages/components/CartPage";
import React from "react";
import {
	useParams,
	BrowserRouter as Router,
	Routes,
	Route,
} from "react-router-dom";

import { AddCartItem } from ".";

function App() {
	return (
		<div className="App">
			<link
				rel="stylesheet"
				href="https://fonts.googleapis.com/css?family=Abhaya Libre"
			/>

			<Router>
				<Routes>
					<React.Fragment>
						<Route path="/" element={<Main />} />
						<Route path="/Cart" element={<CartPage />} />
						<Route path="/Admin" element={<AdminPage />} />
						<Route path="/Admin/CreateItem" element={<CreateItem />} />
						<Route
							path="/item/:ItemId"
							element={
								<ItemPage
									AddItem={(itemid) => {
										AddCartItem(itemid);
									}}
								/>
							}
						/>
					</React.Fragment>
				</Routes>
			</Router>
		</div>
	);
}

export default App;
